import React from 'react';

function ArchivioCard({ url, desc, aspect = 'square' }) {
  const aspectClass = aspect === 'video' ? 'aspect-w-16 aspect-h-9' : 'aspect-square';

  return (
    <div className="flex flex-col gap-2 justify-start items-start">
      <div className={`w-full ${aspectClass}`}>
        <img src={url} className='object-cover w-full h-full' alt={desc} />
      </div>
      <h3 className='w-full text-start uppercase text-xs'>{desc}</h3>
    </div>
  );
}

export default ArchivioCard;
